import { mapKeys } from './mapKeys';
import { pipe } from './pipe';
describe('data first', function () {
    test('mapKeys', function () {
        expect(mapKeys({
            a: 1,
            b: 2,
        }, function (key, value) { return key + value; })).toEqual({
            a1: 1,
            b2: 2,
        });
    });
});
describe('data last', function () {
    test('mapKeys', function () {
        expect(pipe({
            a: 1,
            b: 2,
        }, mapKeys(function (key, value) { return key + value; }))).toEqual({
            a1: 1,
            b2: 2,
        });
    });
});
